import './styles.css';
import { connect } from 'react-redux';
import React, { Fragment } from 'react'
import * as selectors from '../../reducers'
import newBaby from '../newBaby'
import baby from '../baby'

const AppState = ({app}) => (
    <Fragment>
        {
            app ? (
                <newBaby></newBaby>
            ):(
                <baby></baby>
            )
        }
    </Fragment>
)

export default connect(
    (state) => ({
        app: selectors.getAppState(state)
    }),
    undefined
)(AppState)
